import React from "react";

const Navbar=()=> {
    return(
        <nav>
            <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fen.logodownload.org%2Fairbnb-logo%2F&psig=AOvVaw1JXHI-5RUsG5AaKgQb4Sz4&ust=1682838301536000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCKCqvPDCzv4CFQAAAAAdAAAAABAE" className="nav--logo"/>
        </nav>
    )
}
export default Navbar;
